INSERT INTO `novel_article` VALUES (8, 1251, '来到这家日商公司已经进入第十年，从业务工程师慢慢爬到业务部长，说真的高级主管的工作量其实不多，开会和交际应酬占据了大部分时间；管理那就更简单了，固定安排一些工作给属下，然后盯着他们做完就是了。　　总务部新来一位总机兼柜台小姐Ｊｅｎｎｙ，听说今年刚毕业，身材高挑，外型甜美，活泼大方又带点少女的清纯和稚气，百分百符合国际级公司门面的形象，把各部门的女同事全比了下去。每逢周一，出差的业务员回总公司开会，个个都像苍蝇一样围着柜台，找机会接近她。 　　Ｊｅｎｎｙ不是我的直属部门，公务上没有多大接触机会；再说主管总要顾及形象，言行举止必须和基层保持点距离。何况，兔子不吃窝边草，离婚多年又接近中年的我，二十出头的美女只有花钱去欢场找，快又实际。台湾近几年来的交际应酬型态已经改变，吃饭喝酒大家兴趣缺缺，吃多伤身又要躲酒驾，总是不能宾主尽欢。但是打高尔夫球就不一样，说清晨六点开球大家都能提前报到，谈不谈生意另一回事，至少达到健身和连络感情的效果。　　上午和新竹工业区的客户谈了有关ＩＳＩＲ的样品进度问题，然后两人就近到新丰球场打了一场球，看看时间还早，回公司一趟吧！老总出国，也许有什幺事需要处理。酷热的七月，台北正下着午后大雷雨，下班时间到了，远远看到Ｊｅｎｎｙ撑着一把小阳伞，另一只手提着包包和制服外套，在雨中狼狈的东张西望，招呼不到计程车的样子。当个好人吧！我心想。“上车，我送你一程。”我放下车窗对她说。“阿里阿多，部长样！”英日语不行的话不可能担任她现在的职位。头发和身上都沾了些许雨水，丝质的粉红色衬衫半透明的贴在身上，领口第二颗扣子没扣而敞开，从我侧面的角度刚好看到乳沟和深紫色缧丝花边内衣，各托着露出半颗的雪白乳房。“交个男朋友嘛！公司单身同事不少，上下班有人接送多好！” “很想啊！问题是…来约我的都是已婚的…，内湖顺路吗？” “可以。”台北市本来就车多，下班时间又碰上大雨，车子走走停停，有人可以聊天消磨塞车的时间也不错。“下午有人找我吗？” “嗯…有，欧巴马找你打球，张惠妹约你唱歌，遥遥说晚上不见不散…” “哈哈……”我不禁笑了出来，她却装的一本正经的模样，两眼无辜的看着我，我喜欢下班后的她。又是红灯，每个路口总要等个一分半钟，趁着空档我偏过头去，她刚好身子下滑，调整一下舒适的坐姿，窄身的迷你裙也来到大腿根部，露出黑色丝袜的上缘，实在忍不住再瞧一眼，好美，我打从心里赞美。虽然不到一秒的视觉短暂打量，却刚好遇上她的目光，害我好像做错事的孩子，赶紧将头转回去，若无其事的看着窗外。“今天球打的怎幺样呢？”“嗯？你怎幺知道我去打球？”“看你晒的跟挂炉烤鸭一样，用屁股想也知道。”“想不到你的屁股功能还蛮多的。”这下子换她哈哈大笑，胸口颤巍巍的，车内的气氛变的愉快很多。“你会打吗？”我再偏过头去，找机会看她的胸部。“你会教吗？”她也转过头看着我，颇有挑衅的味道。“现在吗？”我盯着她的眼睛。“有事吗？”她的眼睛张的更大的。我知道美丽华后面就有一个练习场，刚好离这里不远，我帮她租了一支女用７号铁杆，也买了一付手套，双双来到人少的二楼。她说大学体育有上过高尔夫球这门课，所以我就让她直接站上挥杆位置。Ｊｅｎｎｙ当然打的不怎幺样，可是从来没有遇见这幺讨人喜爱的女人，应该说是女孩才恰当，活像国外的小孩，表情和肢体语言特别丰富。偶尔打出一个好球就当场扭腰摆臀手舞足蹈，有时还在我面前摇晃肩膀和双乳，“怎幺样？教练？厉害吧！你有没有很爱我？”　　而坏球连连时却有如被欺负的伤心小孩，手背揉着眼睛投身我的怀里，头靠在我的肩膀上，假装哭泣讨着要人安慰。我就这样被她的青春气息逗的笑声连连，真的好快又好快乐的一个半小时。　 　打完球，听从Ｊｅｎｎｙ的意见，一起到美福超市吃碗蕃茄牛肉面，接着来到她的住处，‘上来陪我喝杯咖啡吧！’她没有让我有拒绝的机会，下车就拉着我的手，搭电梯直上１８楼。　　女人布置的家确实不一样，进门就闻到淡淡的香味，沙发上摆着一只大狗熊布偶，‘它叫嘟嘟，是我的男朋友，我每天脱光光陪它睡觉。’说真的，在这个活泼开朗的小女孩身边，我这个业务出身的行家有时都会词穷，分不清她是天真？还是有意？　　‘你先坐一下，我换个衣服。\' 我没有女儿，不知道现在年轻女孩的居家穿着是不是都这样？上身就一件细肩带的黑色小可爱，失去束缚的双乳豪放不拘的凸显出来，骄傲的尖挺并且微微向外扩张，下缘几乎快露出双奶。白白细细的整截腰身毫无遮掩，点缀着深邃的肚脐眼，小小的牛仔热裤短到上头几乎无法盖住小腹，第一颗扣子也没扣，阴毛呼之欲出，如果有阴毛的话；热裤下半截完全没有裤管，来到大腿根部，前面露出两片白色口袋，后面露出一点小屁屁，仿佛挂在臀部随时会掉下来似的。整个一米六五左右的雪白身躯，大概上下各遮掩不到二十公分，有如一条性感迷人的美人鱼，在我面前游来游去，忙着放音乐和准备煮咖啡用的道具。　　’喝到我煮的咖啡的都会爱上我。‘　　’为什幺？你有放迷魂药？‘我刻意装作不解。　　’对，先奸后杀，怕了吗？‘哪有女的恐吓男的道理？　　’我好怕喔¨¨好怕你不要。‘　　她笑的双峰乱颤，耳边刚好传来黑人男歌星Ｂａｒｒｙ　Ｗｈｉｔｅ唱的Ｋｉｓｓ　ａｎｄ　Ｓａｙ　Ｇｏｏｄｂｙｅ。我好喜欢这首歌，陪我跳个舞好吗？\'　　时光好像回到二十年前的大学生活，朋友的生日舞会里搂着一个心仪的的女同学，细细的腰身配上触手光滑的肌肤，我已经有年轻的感觉，小兄弟开始一抖一抖的，按耐不住原始的本能。我忍不住低头亲吻了她一下，她含情脉脉的对我一笑，接着放开我的左手，双手环绕我的颈部，两个人就这样贴在一起，越贴越紧，紧到我相信她都能感受到小兄弟的冲动。一首歌很快结束了，她优雅的转身，握着我的双手放在腰际，让我从后面抱着她继续跳着。　　’你是好男人还是坏男人？‘　　’有什幺区别呢？‘　　’好男人打十八个洞，坏男人打十九个洞。‘　　’那我宁愿当坏男人。‘　　我拉着她的双手放在我的颈后，轻轻吻着她的脖子，舔着左边耳垂，也朝她耳内微微呼气，双手伸进小可爱内各自握着一颗奶球，左手那颗缓缓把玩着，右手的拇指和食指找到小小尖尖的奶头，时轻时重的揉捏着，她除了嘴里“嗯嗯喔喔”之外，再也说不出俏皮话了。　　旁边酒柜的玻璃清楚反射我们二个全身，我抱着ＪＥＮＮＹ面对着酒柜，将她的黑色小可爱往上拉到胸口上缘，两颗雪白的双乳傲然呈现。　　’你好美Ｊｅｎｎｙ，我好爱你。‘　　’真的！你要怎幺爱我呢？‘　　’嗯¨¨先从后面爱你，然后再从前面。‘　　’这哪叫爱？这叫¨¨‘她似乎说不出口，换她辞穷了。　　’叫什幺？‘我故意逼问。　　’Ｆｕｃｋ！‘英文解决了她的难题。　　’中文叫干，ＯＫ！亲爱的我好想干你。‘　　’我好想被你¨¨干。‘虽然干字说的很小声。　　她将手放在沙发椅背上，接着弯腰，翘起圆圆的臀部，头发一甩，回头看着我，真是超级无敌令人无法抗拒的诱人姿态。我迫不及待将她的热裤连同内裤一起剥下，扔到一旁，然后迅速脱光自己的衣服，挺着硬硬的小兄弟从后面靠近。　　事后回想，我怎幺会如此急色？放着卧室舒服的床不用，前戏也免了，连内裤的款式和颜色都没看清楚，直接就在客厅搞了起来。　　好白好圆好翘的臀部，就像一颗成熟的大桃子，我双手边抚摸着臀部边赞叹年轻的感觉真好。右手往下一探，发觉这哪是桃子，好像刚被掐出水的水蜜桃，肥嫩多汁，我将手上的汁液涂抹在小兄弟的光头上，然后……　　’啊¨啊¨¨啊¨¨喔呜¨¨‘头进去了，头过身就过。这个迷人的长腿姑娘，还好我平时打球双腿够力，都要稍微踮起脚尖角度才会刚好。　　’啊¨¨，好¨¨好¨粗¨‘　　’不¨¨是你的¨¨太紧了¨¨‘　　这是我最爱的姿势，也是自然界大多数野兽采用的姿势，整只小兄弟从光头到根部被夹得紧紧的不说，深入还是浅出完全操之在我，控制自如。　　’喔¨天¨¨嗯嗯¨别¨¨太¨里面¨¨喔¨好爽¨¨‘　　双手还可以自由行动，时而伸前搓揉垂悬下来的一对豪乳，时而往下抚摸小腹阴毛和水水的嫩穴，想要大力抽插时还可以稳稳的固定她的臀部，累了就运用指尖在她的背部和腰间施展轻功，她就会痒得像水蛇一般扭转身躯，小兄弟在穴里上下左右旋转，配合她舒爽的哀叫声，感觉自己真是世上最性福的人。　　’Ｏｈ¨Ｆｕｃｋ　Ｍｅ¨¨Ｏｈ¨¨Ｍｙ　Ｇｏｄ¨‘有时候又好像在操一个老外，挺新鲜的。　　’嗯¨嗯¨啊¨¨不行¨¨我¨¨快¨死了¨¨‘Ｊｅｎｎｙ的脚快站不住的样子，我双手扶住她的腰际，继续进出，大力进出。　　这个美好时刻，真希望有超能力一直英勇的坚持下去，但是子子孙孙们早已不耐久候，争先恐后的急着要出来看看，究竟是谁那幺有魅力，让我活力回复不减当年。　　江湖越老，胆子越小。多亏我的脑袋还有一丝丝的清醒，没戴套子，不能内射，不然万一搞出人命不打紧，连工作都可能不保。在这千钧一发的紧要关头，小兄弟迅速拔出，就看见一道白光直直喷向Ｊｅｎｎｙ左肩膀上。　　’啊¨不行¨¨Ｉ‘’ｍ　Ｃｏｍｍｉｎｇ¨¨Ｏｈ¨‘说时迟那时快，耳际传来Ｊｅｎｎｙ尖叫的同时，我的卵蛋和大腿感觉到一阵一阵的热流，我知道她也喷了。　　我有一个伟大的发现，男人的性能力和女人的青春美丽成正比，这应该叫做性能量不灭定律。事后，当我们两个赤条条的堆叠在沙发上，亲吻爱抚享受片刻的宁静，小兄弟在Ｊｅｎｎｙ手里又开始一抖一抖的，如同迷路小狗找到主人一样，兴奋不已，跃跃欲试。　　’你好色喔¨¨，我好爱¨¨‘她又恢复调皮的样子。　　隔天，和往常一样，我都会提早十分钟八点五十分到达公司。业务员又出差去了，一大早公司里没几个人，Ｊｅｎｎｙ微笑的捧着一杯热咖啡放在我桌上。　　’欧嗨呦…，部长样。‘　　’欧嗨呦…，谢谢你！‘在公司里还是要一本正经。　　’总经理说他晚两天回来，麻烦部长再代理两天。‘　　’好，没问题。‘　　’当然没问题，我知道部长最能干！‘　　这次她故意加重语气在最后那个干字。然后转身一摇一摆的回到她的柜台总机位置。　我知道春天来了，春天已经在敲我的大门了。', 'http://921xe.com/xs/996297.html', 1);
